import './ExpenseItem.css'

function ExpenseItem(props) {

    const expenseDate = new Date(2022, 5, 25) // declares initial date, title, and amount -- can change
    const expenseTitle = "Ecstatic Dance"
    const expenseAmount = 12

    return (
    <div className="expense-item">
        <div>{expenseDate.toISOString()}</div> {/* just expenseDate breaks. Needs toISOString() */}
        <div className="expense-item__description">
            <h2>{expenseTitle + ' Fund'}</h2>
            <div className="expense-item__price">$ {expenseAmount}</div>
        </div>
    </div>
    )
}

export default ExpenseItem;
